script: |
  super -f text -I q9903.spq | sort > q9903.out

inputs:
  - name: q9903.spq
    data: |
      SELECT + 92 * 7 + 23 AS col0 FROM tab1 (FORMAT parquet) WHERE + 41 + - CAST ( + col1 AS REAL ) NOT BETWEEN ( - 14 ) + + col0 / - ( + CAST ( 41 AS REAL ) ) AND + col0;
  - name: tab1

outputs:
  - name: q9903.out
    data: |
